import React from "react";
import { ThemeContext } from '../theme/theme-context';

const { dark, theme, toggle } = useContext(ThemeContext);

const ImageRenderer =({image}) => {
    return <img style={{
        maxWidth: "20vw",
        marginTop: 100,
        
    }}src={image} />
    
};
export default ImageRenderer;
